  //   if (this.state.minPriceTracker < 0) {
  //     this.state.minPriceTracker = 0;
  //   }
  //   if (this.state.maxPriceTracker < 0) {
  //     this.state.maxPriceTracker = 0;
  //   }
  //   if (this.state.minPriceTracker == 0 && this.state.maxPriceTracker == 0) {
  //     this.state.errorMessage = "Please choose a minimum or maximum price."
  //     this.state.isSearchButtonDisabled = true;
  //   }
  //   else if (this.state.minPriceTracker > this.state.maxPriceTracker) {
  //     this.state.errorMessage = "Maximum price must be greater than minumum price."
  //     this.state.isSearchButtonDisabled = true;
  //   }
  //   else if (this.state.maxPriceTracker == 0) {
