  //     this.state.isSearchButtonDisabled = true;
  //   }
  //   else {
  //     this.state.errorMessage=""
  //     this.state.isSearchButtonDisabled = false;
  //   }
  // }

  var [minPriceTracker, setMinPriceTracker] = useState("");
  var [maxPriceTracker, setMaxPriceTracker] = useState("");
  var [errorMessage, setErrorMessage] = useState("Please enter at least one search criterion");
  var [isSearchButtonDisabled, setIsSearchButtonDisabled] = useState(true);

  // const checkIfPriceNegative = function(event) {
  //   if (event.target.value < 0) {
  //     event.target.value = 0;
  //   }
  // }

  return (
    <div>
      <h1> Search </h1>

      <form id="search-form" method="GET">
        <label htmlFor="address">Address</label>
        <input name="address" id="address" placeholder="Address" type="text" />
        <label htmlFor="min_price">Minimum Price</label>
        <input name="min_price" id="min_price" placeholder="Minimum price" type="number" onBlur={(event) => function(event) {
          if (event.target.value < 0) {
            event.target.value = 0;
          }}} />
        <label htmlFor="max_price">Maximum Price</label>
        <input name="max_price" id="max_price" placeholder="Maximum price" type="number" onBlur={(event) => function(event) {
          if (event.target.value < 0) {
            event.target.value = 0;
          }}}/>
        <label htmlFor="numBedrooms"># of Bedrooms</label>
        <select id="numBedrooms" name="numBedrooms" defaultValue="">
            <option value="" disabled>Select Beds</option>
            <option value="noselection">No Selection</option>
            <option value="1">1 Bed</option>
            <option value="2">2 Beds</option>
            <option value="3">3 Beds</option>
            <option value="4">4 Beds</option>
            <option value="5">5 Beds</option>
        </select>
        <label htmlFor="numBathrooms"># of Bathrooms</label>
        <select id="numBathrooms" name="numBathrooms" defaultValue="">
            <option value="" disabled>Select Beds</option>
            <option value="noselection">No Selection</option>
            <option value="1">1 Bed</option>
            <option value="2">2 Beds</option>
            <option value="3">3 Beds</option>
            <option value="4">4 Beds</option>
            <option value="5">5 Beds</option>
        </select>
        <div id="errorMessage">{errorMessage}</div>
        <button type="submit" disabled={isSearchButtonDisabled}> Search </button>
      </form>
    </div>
  )
}

export default PropertySearchForm
